import React from 'react';
import Link from 'next/link';
import AppLayOut from '../components/AppLayOut';

const Home = () => {
  return (
    <>
      <AppLayOut>
        <Link href="/about"><a>about</a></Link>
        <div>Hello, Next!</div>
      </AppLayOut>
    </>
  );
};

export default Home;
